import React from 'react'

const Categories = ({ items, filterItems }) => {
  items.map((categories) => {
    const { id, category } = categories

    return (
      <div className="btn-container">
        <button
          key={id}
          className="filter-btn"
          onClick={() => {
            filterItems({ category })
          }}
        >
          Breakfast
        </button>
      </div>
    )
  })
}

export default Categories
